import React, { useEffect } from 'react';
import '../../CSS/Login.css';

function SignUp() {
  useEffect(() => {
    const signUpButton = document.getElementById('a_signUp');
    const signInButton = document.getElementById('a_signIn');
    const main = document.getElementById('a_main');

    signUpButton.addEventListener('click', () => {
      main.classList.add('right-panel-active');
    });

    signInButton.addEventListener('click', () => {
      main.classList.remove('right-panel-active');
    });

    return () => {
      signUpButton.removeEventListener('click', () => {
        main.classList.add('right-panel-active');
      });

      a_signInButton.removeEventListener('click', () => {
        main.classList.remove('right-panel-active');
      });
    };
  }, []);

  return (
    <div className="a_container" id="a_main">
      <div className="a_sign-up">
        <form action="#">
          <h1>Create Account</h1>
          <div className="a_social-container">
            <a href="#" className="a_social">
              <i className="fab fa-facebook-f"></i>
            </a>
            <a href="#" className="a_social">
              <i className="fab fa-google-plus-g"></i>
            </a>
            <a href="#" className="a_social">
              <i className="fab fa-linkedin-in"></i>
            </a>
          </div>
          <p>or use your email for registration</p>
          <input type="text" name="txt" placeholder="Name" required="" />
          <input type="email" name="email" placeholder="email" required="" />
          <input type="password" name="pswd" placeholder="Password" required="" />
          <button>Sign UP</button>
        </form>
      </div>
      <div className="a_sign-in">
        <form action="#">
          <h1>Sign in</h1>
          <div className="a_social-container">
            <a href="#" className="a_social">
              <i className="fab fa-facebook-f"></i>
            </a>
            <a href="#" className="a_social">
              <i className="fab fa-google-plus-g"></i>
            </a>
            <a href="#" className="a_social">
              <i className="fab fa-linkedin-in"></i>
            </a>
          </div>
          <p>or use your account</p>
          <input type="email" name="email" placeholder="email" required="" />
          <input type="password" name="pswd" placeholder="Password" required="" />
          <a href="#">Forgot your Password?</a>
          <button>Sign In</button>
        </form>
      </div>
      <div className="a_overlay-container">
        <div className="a_overlay">
          <div className="a_overlay-left">
            <h1>Welcome Back!</h1>
            <p>To keep connected with us please login with your personal info</p>
            <button id="a_signIn">Sign In</button>
          </div>
          <div className="a_overlay-right">
            <h1>Hello, Friend</h1>
            <p>Enter your personal details and start the journey with us</p>
            <button id="a_signUp">Sign Up</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default SignUp;
